# imports some software packages we'll use
import math
import pandas as pd
import numpy as np
from math import cos,sin,pi,sqrt
import matplotlib as mpl
import matplotlib.pyplot as plt

# Defining the constants
g = 9.8 # gravitational acceleration (m^2/s)
m = 0.6 # mass of the ball (kg)
r = 0.12 # radius of the ball (m)
# Using the equation from the textbook and given D=0.24 m and gamma= 0.25 N*(s^2/m^4)
C = 0.0144 # drag coefficient N*(s^2/m^2)

v0 = 15 # initial velocity (m/s)
theta = 45  # angle of projection in degrees
x0 = 0 # initial x-position (m)
y0 = 2 # initial y-position (m)
dt = 0.01 # time step in (s)
tmax= 10 #(s)

# The zeros_like() function is used to get an array of zeros with the same shape and type as a given array.

# np.arragne() makes an instance of an array while creating evenly spaced values and returns the reference to it.
# In this case 0 is the start of t , tmax is the end and dt is how it should spaced
#We find terminal velocity from the equation in the powerpoint
Vt=((m*g)/C)**(1/2)
print(Vt)

# Initialize arrays
t = np.arange(0, tmax, dt)
xDrag = np.zeros_like(t)
yDrag = np.zeros_like(t)
vxDrag = np.zeros_like(t)
vyDrag = np.zeros_like(t)
tlist = np.zeros_like(t)

# Set initial conditions
tlist[0]=0
xDrag[0] = 0
yDrag[0] = y0
vxDrag[0] = v0 * np.cos(theta)
vyDrag[0] = v0 * np.sin(theta)

def force_x(vx, vy):
  return -C * sqrt(vx**2+vy**2) * vx

def force_y(vx, vy):
  return -m * g - C* sqrt(vx**2+vy**2) * vy

# Numerically integrate equations of motion
for i in range(1, len(t)):

    # Calculate acceleration with Drag
    axDrag = (force_x(vxDrag[i-1],vyDrag[i-1])) / m
    ayDrag = (force_y(vxDrag[i-1],vyDrag[i-1])) / m

    # Update velocities with Drag
    vxDrag[i] = vxDrag[i-1] + axDrag * dt
    vyDrag[i] = vyDrag[i-1] + ayDrag * dt

    # Update positions with Drag
    xDrag[i] = xDrag[i-1] + vxDrag[i-1] * dt
    yDrag[i] = yDrag[i-1] + vyDrag[i-1] * dt

    tlist[i]=i
  # Check if the ball hits the ground and stop the simulation
    if yDrag[i] <= 0:
        xDrag = xDrag[:i]
        yDrag = yDrag[:i]
        vxDrag = vxDrag[:i]
        vyDrag = vyDrag[:i]
        tlist = tlist[:i]
        break

data = pd.DataFrame({ "t":tlist,"X Drag":xDrag, "Y Drag": yDrag, "Vx Drag": vxDrag, "Vy Drag":vyDrag})
data

